import React from 'react'
import { Container , Navbar } from 'react-bootstrap'

const layout = ({children}) => {
  return (
    <>
    <Navbar bg="primary" variant="dark">
        <Navbar.Brand>JWT HTTP-Only Cookie</Navbar.Brand>
    </Navbar>
    <Container>
         {children}
    </Container>
    </>
  )
}

export default layout
